import React from 'react';
import { PieChart, Pie, Cell, Tooltip, Legend, ResponsiveContainer } from 'recharts';
import { useModal } from '../../context/ModalContext';
import InsightCard from '../insight/InsightCard';
import { useAuth } from '../../context/AuthContext';
import '..'
const COLORS = ['#4e79a7', '#f28e2c', '#e15759', '#76b7b2'];

function Save({ data }) {
  const { auth } = useAuth();
  const { showModal } = useModal();

  const showInsight = () => {
    showModal(<InsightCard value={'save'} />);
  };

  if (!data) return null;

  const chartData = [
    { name: 'SBI', value: data.SBI || 0 },
    { name: 'AXIS', value: data.AXIS || 0 },
    { name: 'IDBI', value: data.IDBI || 0 },
    { name: 'MISC', value: data.MISC || 0 },
  ].filter(item => item.value > 0);

  return (
    <div style={{ padding: '1rem', background: '#f9f9f9', borderRadius: '12px', boxShadow: '0 4px 12px rgba(0,0,0,0.08)' }}>
      
      <div style={{ display: 'flex', justifyContent: 'flex-end' }}>
        <button 
          onClick={showInsight}
          style={{
            padding: '0.5rem 1rem',
            border: 'none',
            borderRadius: '8px',
            backgroundColor: '#007bff',
            color: 'white',
            fontWeight: 'bold',
            cursor: 'pointer',
            transition: 'background-color 0.2s'
          }}
          onMouseOver={e => e.target.style.backgroundColor = '#0056b3'}
          onMouseOut={e => e.target.style.backgroundColor = '#007bff'}
        >
          Insight
        </button>
      </div>

      <div style={{ display: 'flex', justifyContent: 'space-between', gap: '2rem', flexWrap: 'wrap', marginTop: '1rem' }}>

        {/* LEFT TABLE */}
        <div style={{ flex: 1, minWidth: '280px' }}>
          <table style={{ width: '100%', borderCollapse: 'collapse', fontSize: '0.95rem' }}>
            <thead>
              <tr style={{ backgroundColor: '#e9ecef' }}>
                <th style={{ padding: '10px', textAlign: 'left', borderBottom: '1px solid #ccc' }}>Bank</th>
                <th style={{ padding: '10px', textAlign: 'right', borderBottom: '1px solid #ccc' }}>Amount (₹)</th>
              </tr>
            </thead>
            <tbody>
              {chartData.map((entry, index) => (
                <tr key={index} style={{ backgroundColor: index % 2 === 0 ? '#fff' : '#f5f5f5' }}>
                  <td style={{ padding: '10px' }}>{entry.name}</td>
                  <td style={{ padding: '10px', textAlign: 'right' }}>{entry.value.toLocaleString()}</td>
                </tr>
              ))}
              <tr style={{ fontWeight: 'bold', borderTop: '2px solid #ccc', backgroundColor: '#e9ecef' }}>
                <td style={{ padding: '10px' }}>Total</td>
                <td style={{ padding: '10px', textAlign: 'right' }}>{data.TOTAL.toLocaleString()}</td>
              </tr>
            </tbody>
          </table>
        </div>

        {/* RIGHT PIE CHART */}
        <div style={{ flex: 1, minWidth: '280px', height: 250 }}>
          <ResponsiveContainer>
            <PieChart>
              <Pie
                data={chartData}
                dataKey="value"
                nameKey="name"
                cx="50%"
                cy="50%"
                outerRadius={100}
                label
              >
                {chartData.map((entry, index) => (
                  <Cell key={`cell-${index}`} fill={COLORS[index % COLORS.length]} />
                ))}
              </Pie>
              <Tooltip />
              <Legend verticalAlign="bottom" height={36} />
            </PieChart>
          </ResponsiveContainer>
        </div>

      </div>
    </div>
  );
}

export default Save;
